INSERT INTO `hakkimizda` (`Hak_ID`, `Baslik`, `Mesaj`, `Durum`) VALUES
(1, 'HAKKIMIZDA', 'Temel ilkesi kaliteli estetik bilincini topluma başarıyla yaymayı amaç edinmiş merkezimiz dış görünüşüne ve sağlıgına önem veren bayan ve bayların en çok başvuracağı mekanlardan biridir.Sizlerin memnuniyetinden aldığımız güç ve bize olan inancınız ik yns güzellik büyüyor.Müşterilerimzin rahat ve konforu için her türlü detay düşünülerek dekore edilmiş geniş ferah merkezimizin sıcak ambiyansı sizlerde hissedeceksiniz.Hedeflerimiz arasında hastaların endişelerinin gidererek arzularını yerine getirilmesi uygulamalarda müşteri memnuniyeti ön planda tutulmuştur.Merkezimizde profesyonel ve gülen yüzlü sağlıklı hijyenik bir ortamda uygun fiyat ve müşteri memnuniyeti odaklı çalışma prensibi uygulanmaktadır.Merkezimizi ziyaret ederek üyemiz olma ayrıcalığını yaşama sırası artık sizde.\n\n', '0');
