INSERT INTO `hizmetler` (`H_ID`, `H_Adi`, `HK_Adi`, `Metin1`, `Metin2`, `Image_Link`, `H_Tutar`, `H_Cins`, `Durum`) VALUES
(1, 'Lazer Epilasyon', 'LzEpjk', '<strong>Lazer Epilasyon</strong><br>       İstenmeyen tüylerin, çeşitli yöntemlerle kalıcı olarak yok edilmesine epilasyon denir.', '<strong>Epilasyon hangi bölgelere yapılır?</strong><br>\n      <p> Epilasyon vücudun tüm bölgelerinde rahatlıkla uygulanır. Koltuk altı, bikini, yüz, çene, boğaz, ense, kol, bacak ve el bölgeleri, istenmeyen tüylerin giderilmesi amacıyla epilasyonun uygulandığı en yaygın bölgelerdir.</p><br>\n<strong>Epilasyon işlemi ne kadar sürer?</strong><br>\n<p>Epilasyon işlemi oldukça kısa sürer, çok kısa sürelerde büyük alanlarda çalışma yapılabilir. Uygulama yapılacak her bölge, genişliğine göre farklı sürede tamamlanır. Örneğin tüm bacaklar, sırt gibi büyük alanlar ortalama 2 – 2,5 saat; koltuk altı, bikini bölgesi, yüz gibi daha küçük bölgeler 10 – 15 dakika; bıyık, çene gibi küçük bölgeler 2-3 dakika gibi sürelerde tamamlanmaktadır.</p><br>\n \n\n <strong>Epilasyon ağrı yapar mı?</strong><br>\n      <p> Günümüzde hiçbir epilasyon yöntemi ağrısız değildir. Kişiden kişiye değişen ağrı eşiğine bağlı olarak, Epilasyon sırasında ağrı duyulabilir. Bazı kişilerde bu ağrı hissedilmezken, bazı kişilerde ise daha şiddetli hissedebilir. En fazla ağrı duyulan bölge bikini bölgesidir. Ayrıca erkeklerde ve koyu kalın kıllara sahip kişilerde ağrı duyma daha şiddetli olabilir.</p><br>\n \n\n<strong> Epilasyonda kaç seans sonra sonuç alınabilir?</strong><br>\n       <p>Vücut kılları büyüme (anajen), gerileme (katajen) ve dinlenme ( telojen) olarak adlandırılan üç gelişim evresinde bulunur. Her kıl değişik evrelerde olduğundan epilasyonda istenmeyen tüylerin zayıflatılması ve yok edilmesi zaman almatadır. Epilasyon sadece büyüme (anajen) evresindeki kılları etkiler. Bütün kıl kökleri aynı evrede olmadığı için tek uygulamada bölgedeki tüm kılları yok etmek mümkün değildir. Herkesin vücut yapısı, hormon seviyeleri ve cilt tipi farklı olduğundan sonuca ulaşmak için gereken süre kişiden kişiye değişmektedir. Genellikle bu süreç 1 ila 1,5 yıl sürer. Bu sürede vücut bölgelerine ortalama 5-6 kez; yüz bölgesine 7-8 kez uygulama yeterli olabilir. Uygulama sıklığı yüz bölgesinde 1 – 1,5 ay, vücut bölgelerinde 2 – 2,5 aydır.</p><br>\n \n\n <strong>Epilasyon ne zaman yapılmalı?</strong><br>\n     <p>Kalıcı epilasyon ancak büyüme evresindeki kıllarda etkili olur. Gerileme ve dinlenme evresindeki kılların kıl kılıfı yok olmaz. Bu nedenle epilasyon uygulama aralıklarının çok iyi ayarlanması gerekir. Genel olarak, yüzdeki tüylerin % 75’i büyüme (anagen) evresinde, % 25’i dinlenme (telogen) evresindedir. Bundan da anlaşılacağı gibi, yüz tüylerinin epilasyonu için daha geniş bir zaman seçeneği bulunur. Vücut tüylerinde ise durum tersidir; % 25 büyüme, % 75 dinlenme döneminde olurlar. Büyüme evre süresi vücutta bölgeden bölgeye değiştiği gibi, kişiden kişiye de değişir. Bu nedenle epilasyon uygulama aralıklarının kişiye özel ayarlanması gerekir. Aksi takdirde yapılacak işlemler zaman kaybından ve müşterinin oyalanmasından başka sonuç vermez.</p><br>\n \n\n <strong>Epilasyondan nasıl sonuç alınır?</strong><br>\n       <p> Epilasyonda sağlanan başarı kişiden kişiye değiştiği gibi aynı kişide bölgeden bölgeye bile farklılıklar gösterebilmektedir.</p><br>\n \n\n<strong> Epilasyon kimlere uygulanmaz?</strong><br>\n\n <p>*Akut deri enfeksiyonu olan kişilere<br>\n\n    *Uçuk enfeksiyonu olan kişilere<br>\n\n    *Dövme ve yaygın benleri olan kişilere<br>\n\n    *Yakın zamanda bronzlaşmış kişilere<br>\n\n    *Hormon bozukluğu olan kişilere<br>\n\n    *Romatizma için altın tedavisi alan kişilere<br>\n\n    *Anormal nedbe ve keloid (aşırı büyüyen leke, yara) geliştirme riski olan kişilere<br>\n\n    *Sedef ve vitiligo (Ala) hastalığı olan kişilere<br>\n\n    *Son bir yıl içinde roaccutane ilacı alan kişilere<br>\n\n    *Gebe ve emziren kişilere Epilasyon uygulaması yapılmaz.</p><br>\n\n \n\n <strong>Epilasyondan sonra ne yapılmalı?</strong><br>\n\n   <p> *Uygulama aralarında çıkan tüylere ağda, ip, cımbız gibi yöntemler uygulanılmamalıdır.<br>\n\n    *Epilasyonda oluşan kızarıklıklar devam ettiği sürece güneşten korunmalıdır.<br>\n\n    *Güneşe maruz kalan bölgelere yağ içermeyen ve yüksek etkili güneş koruyucu kremler sürülmelidir.<br>\n\n    *Kişi terleten sıcak ortamlardan kaçınılmalıdır.Uygulama yapılan bölgeyi sıcak su ile yıkama, lifi sürtme ve saç kurutma makinesi kullanma uygulamalarından kaçınılmalıdır.<br>\n\n    *Uygulamayı takip eden birkaç gün içerisinde cilde daha hassas davranılmalıdır.<br>\n\n    *Epilasyon sonrası cildinde sulanma olan kişilere, bölgesel kortikosteroid, antibiyotik ve nemlendiriciler önerilmektedir</p>\n', 'assets/images/01.jpg', '1000', 'Bay', '1'),
